The Drill: Just their type Oct. 22, 2015 7:28 p.m. (0) Comments Rick Wood Green Bay Packers running back Eddie Lacy (27) is stopped by San Diego Chargers strong safety Jimmy Wilson (27) in the second half during the Green Bay Packers 27-20 win over the San Diego Chargers at Lambeau Field. 
Here are some thoughts found on Twitter this week. Go to 
jsonline.com/sportstweets for links to accounts of state athletes. 
@MatthewBusche (professional cyclist) 
Different outlooks on life: guy asks where I rode from & then says I deserve 2 smoke some weed for having ridden 4 hours. Thanks, I'll pass! 
@DrewGooden (former Bucks forward) 
Back in Milwaukee. Didn't realize how much love I still receive here from the fans. I love you Mil-Town #gobucks #FearTheDeer 
@MCW1 (Bucks guard Michael Carter-Williams) 
I love the feeling when you realize what truly matters in life. I pray for all of you that haven't hit that stage yet. 
@ShowtimeMr1 (Bucks guard Rashad Vaughn) 
It's always family first 
@Johnhenson31 (Bucks forward) 
When a chick exposes her craziness before y'all even really start talking...run the other way as fast as possible lol 
@MrJonBrockman (former Bucks forward) 
I may have found the only Chevy Blazer in all of Europe. And she is a beauty! Respect! 
@IAM_Dat_One (Packers defensive end Datone Jones) 
What a game GB! That was for my wife and newborn daughter. she was all smiles from back home 
@JermichaelF88 (former Packers tight end Jermichael Finley) 
To the Green Bay Packer Fans: Thank you for 6 unbelievable years & unforgettable memories. You guys made my dreams come true. Go Pack Go 
@Lil_Eazy_Ana_42 (Packers running back Eddie Lacy) 
Fantasy football coaches: don't talk smack unless you know the history. Respect the OGs. 
